/*
  Author: Caden Otis
  ISU Netid: crotis
  ISU Email: crotis@iastate.edu
  Date: March 25th, 2024
*/

import React from "react";
import ReactDOM from "react-dom/client";
import { UserCard } from "./crotis_Activity09_Modules_Components_Props_UserCard.js";

// init React :
const rootElement = document.getElementById("root");
const root = ReactDOM.createRoot(rootElement);

// render something HTML :
root.render(<h1>Hellow World!</h1>);

root.render(
  <div>
    <UserCard
      picture=" https://media-cldnry.s-nbcnews.com/image/upload/t_fit-1500w,f_auto,q_auto:best/newscms/2018_45/2456801/180606-mark-zuckerberg-se-3221p.JPG"
      name="Mark Zuckerberg"
      amount={3000}
      married={true}
      points={[100, 101.1, 202, 2]}
      address={{ street: "123 Bellmont Rd.", city: "Ames", state: "Iowa" }}
    />
    <UserCard
      picture="https://imageio.forbes.com/specials-images/imageserve/62d599ede3ff49f348f9b9b4/0x0.jpg?format=jpg&crop=821,821,x155,y340,safe&height=416&width=416&fit=bounds"
      name="Bill Gates"
      amount={3500}
      married={true}
      points={[1, 2, 3, 4]}
      address={{ street: "5010 Av Some", city: "Tempe", state: "AZ" }}
    />
  </div>
);
